import React,{ useSate } from 'react';


function SignupScreen(){

	const [username, setUsername]     = useSate('');
	const [firstname, setFirstname]   = useSate('');
	const [lastname, setLastname]     = useSate('');
	const [email, setEmail]           = useSate('');
	const [password1, setPassword1]   = useSate('');
	const [password2, setPassword2]   = useSate('');

	const [isPassword1TypePass, setPassword1TypePass]   = useSate(true);
	const [isPassword2TypePass, setPassword2TypePass]   = useSate(true);

	return(
		<div className='SignupScreen'>
			<input type='text' onChange={e=>{setUsername(e.target.value)}} value={username}/>
			<input type='text' onChange={e=>{setFirstname(e.target.value)}} value={firstname}/>
			<input type='text' onChange={e=>{setLastname(e.target.value)}} value={lastname}/>
			<input type='text' onChange={e=>{setEmail(e.target.value)}} value={email}/>
			<input type={isPassword1TypePass?'password':'text'} onChange={e=>{setPassword1(e.target.value)}} value={password1}/>
			<button onClick={setPassword1(!isPassword1TypePass)}>{isPassword1TypePass?'show':'hide'}</button>
			<input type={isPassword2TypePass?'password':'text'} onChange={e=>{setPassword2(e.target.value)}} value={password2}/>
			<button onClick={setPassword2(!isPassword2TypePass)}>{isPassword2TypePass?'show':'hide'}</button>
		</div>
	);
}

export default SignupScreen;
